import React from "react";
export default React.memo(function Card(props) {
  const foodCategory = props.foodCategory;
  const foodData = props.foodData;
  return (
    <div className="container">
      {
        foodCategory.map((catagoryData)=>{
          return (
            <>
              <div className="ps-1 pe-2 border-bottom border-white mt-2 mb-2">{catagoryData.CategoryName}</div>
              <div className="row row-cols-3">
                {foodData.map((fData) => {
                  return (
                      fData.CategoryName===catagoryData.CategoryName && (
                        <div className="col" key={fData._id}>
                      <div
                        className="card"
                        key={fData._id}
                        style={{ width: "18rem" }}
                      >
                        <img
                          src={fData.img}
                          className="card-img-top"
                          style={{ objectFit: "cover", height:"50px" }}
                          alt="..."
                        />
                        <div className="card-body">
                          <h5 className="card-title ps-1">
                            {fData.name}
                          </h5>
                          <div className="d-flex align-items-center justify-content-between pe-1 ps-1">
                            <select
                              className="form-select w-50"
                              aria-label="Default select example"
                            >
                              <option selected>Select Quantity</option>
                              {fData.options.map((data) => {
                                return <option>{data.full}</option>;
                              })}
                            </select>
                            <button type="button" class="btn btn-primary">
                              Add
                            </button>
                          </div>
                        </div>
                      </div>
                    </div>
                      )
                  );
                })}
              </div>
            </>
          );
        })
      }
    </div>
  );
})
